import { Section, UserAvatar, UserLogin } from "./styles"



const UserFollowers = (props) => {


    return (
        <Section>
                <UserLogin>{(props?.login)}</UserLogin>

                <UserAvatar>{(props?.avatar_url)}</UserAvatar>
        </Section>
    )
}

export default UserFollowers
